import React from 'react';
import { Section } from './Header.styled';
import { MenuBtn, LogoImg, TitleWeather, TitleApp} from './Header.styled';
import { MenuBurgerImg } from 'icons/IconComponent.jsx';

import LogoImg1 from '../img/free-icon-weather-app-3845731.png';

export const Header = () => {
  return (
    <Section>
      <MenuBtn
        type="button"
        aria-label="burger-menu"
        title="Menu"
        onClick={() => {
          console.log('Menu open');
        }}
      >
        <MenuBurgerImg />
      </MenuBtn>
      
    </Section>
  );
};
